import React, { Component } from "react";
import "./style.css";

class Search extends Component {
    state = {

    }


    render() {
        return (
            <div>
                <div className="saved">
                    <h3>Search</h3>
                    <h5>Book</h5>
                    <form>

                    </form>
                </div>



                {/* SHOW RESULTS */}
                <div className="saved">
                    <h3>Results</h3>
                    {this.state.books.map(book => (
                        <div className="book">
                            <div className="top">
                                <h3>{book.title}</h3>
                                <div className="button">
                                    <a href={book.link}>View</a>
                                    <a>Delete</a>
                                </div>
                            </div>
                            <p>Written By: {book.authors}</p>
                            <div className="body">
                                <img src={book.image}></img>
                                <p>{book.description}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        )
    };
}

export default Search;
